<?php

namespace Appleton\Taxes\Seeds\US\Alabama;

use Appleton\Taxes\Countries\US\Alabama\AlabamaIncome;
use Appleton\Taxes\Countries\US\Alabama\AlabamaUnemployment;
use DB;
use Illuminate\Database\Seeder;

class AlabamaSeeder extends Seeder
{
    public function run()
    {
        if (DB::table(config('taxes.governmental_unit_areas'))->where('name', 'Alabama')->exists()) return;

        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'Alabama',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([[
            'name' => 'Alabama Income Tax',
            'tax' => AlabamaIncome::class,
            'governmental_unit_area_id' => $id,
        ],[
            'name' => 'Alabama Unemployment Tax',
            'tax' => AlabamaUnemployment::class,
            'governmental_unit_area_id' => $id,
        ]]);
    }
}
